import api from './api';

export const listInvites = () =>
    api.get('/admin/invites').then(r => r.data);

export const createInvite = (minutes = 10) =>
    api.post('/admin/invites', { minutes }).then(r => r.data);

export const revokeInvite = (id) =>
    api.delete(`/admin/invites/${id}`).then(r => r.data);
